	rgb(147,223,184)
	rgb(235,220,200)
	rgb(238,237,219)
	rgb(227,170,214)
	rgb(181,216,235)
	rgb(238,242,230)
	rgb(255,237,201)
	rgb(255,200,186)
	rgb(37,41,42)
	rgb(161,219,178)
	rgb(230,230,220)
	rgb(218,221,251)
	rgb(248,218,251)
	rgb(255,171,171)
	rgb(15,219,159)
	rgb(218,251,248)
	rgb(221,229,254)
	rgb(226,255,230)
*/
#intentions-list {
  width: auto;
  display: inline-block;
  min-width: 200px;
  max-width: 800px;
  padding: 0;
  overflow: hidden;
  color: #9fa5b1;
}
#intentions-list li {
  padding: 0 10px;
}
#intentions-list ol {
  overflow-y: hidden;
  margin-top: 0px;
}
#intentions-list.intentions-scroll ol {
  overflow-y: scroll;
}
.intentions-inline {
  pointer-events: none;
  position: absolute;
  margin-top: 0.1em;
  text-decoration: underline;
}
